// src/views/VideoPlayer.js
import React from 'react';
import { Header, Panel } from '@enact/sandstone/Panels';
import BodyText from '@enact/sandstone/BodyText';

const VideoPlayer = ({ videoUrl, onBack }) => {
    return (
        <Panel>
            <Header title="비디오 재생" onBack={onBack} /> {/* 뒤로 가기 버튼 추가 */}
            <BodyText>여기에 비디오 플레이어를 추가하세요.</BodyText>
            {videoUrl ? (
                <video controls width="100%" style={{ maxWidth: '600px' }}>
                    <source src={videoUrl} type="video/mp4" />
                    죄송하지만 비디오를 재생할 수 없습니다.
                </video>
            ) : (
                <p>재생할 비디오가 없습니다.</p>
            )}
        </Panel>
    );
};

export default VideoPlayer;
